import React from "react";
import { Jumbotron, Navbar } from "reactstrap";
import Footer from "../components/Footer";

const AboutUs = () => {
  return (
    <div>
      <Navbar />
      <div className="about-us">
        <Jumbotron></Jumbotron>
      </div>
      <Footer />
    </div>
  );
};

export default AboutUs;
